    false,nt"url": null,nt"notes": "The Merritt Island NWR Visitor Services
    Plan outlines long term and short term goals for six wildlife dependent public use
    activities and programs that are compatible with the mission of the Refuge system.
    These activities include hunting, fishing, wildlife observation, wildlife photography,
    environmental education and interpretation. The implementation of this plan insures
    that all public use activities and programs on the refuge will be in conformance
    with national guidelines and will insure that all visitor activities are compatible
    with the refuge's overarching wildlife mission and purposes.",nt"license_title":
